void Robot_State::ZMP_real(Vector6D& FT_L,Vector6D& FT_R,Vector3D& L_posi,Vector3D& R_posi, Vector3D& ZMP_real_val)
{
    Vector2D sum;
    sum.setZero();

    sum(0) = FT_L(4)+FT_R(4)-(L_posi(0)*FT_L(2)+R_posi(0)*FT_R(2));
    sum(1) = -FT_L(3)-FT_R(3)+(L_posi(1)*FT_L(2)+R_posi(1)*FT_R(2));

    ZMP_real_val(0) = -sum(0)/(FT_L(2)+FT_R(2));
    ZMP_real_val(1) = sum(1)/(FT_L(2)+FT_R(2));
    ZMP_real_val(2) = 0.0;

    Vector2D Left_ZMP;
    Left_ZMP(0) = FT_L(4)/FT_L(2);
    Left_ZMP(1) = FT_L(3)/FT_L(2);
    Left_ZMP(0) = Left_ZMP(0)+L_posi(0);
    Left_ZMP(1) = Left_ZMP(1)+L_posi(1);

    Vector2D Right_ZMP;
    Right_ZMP(0) = FT_R(4)/FT_R(2);
    Right_ZMP(1) = FT_R(3)/FT_R(2);
    Right_ZMP(0) = Right_ZMP(0)+R_posi(0);
    Right_ZMP(1) = Right_ZMP(1)+R_posi(1);

    ZMP_real_val(0) = (Left_ZMP(0)*FT_L(2)+Right_ZMP(0)*FT_R(2))/(FT_L(2)+FT_R(2));
    ZMP_real_val(1) = (Left_ZMP(1)*FT_L(2)+Right_ZMP(1)*FT_R(2))/(FT_L(2)+FT_R(2));
}



void Robot_State::GlobalForceMomentCustomPos(Matrix3D &rotMat, Vector3D &distance, Vector6D &LocalForceMoment, Vector6D& GlobalForceMoment)
{
    Matrix6D Rotation;
    Rotation.setZero();

    for (int i=0; i<3; i++)
    {
        for (int j=0; j<3;j++)
        {
            Rotation(i,j)= rotMat(i,j);
            Rotation(i+3,j+3)=rotMat(i,j);
        }
    }
    Matrix3D Phat;
    Phat.setZero();
    Skew(distance,Phat);

    Matrix6D Rotation1;
    Rotation1.setZero();

    for (int i=0; i<3; i++)
    {
        Rotation1(i,i)= 1.0;
        Rotation1(i+3,i+3)= 1.0;

        for (int j=0; j<3;j++)
        {
            Rotation1(i+3,j)= -Phat(i,j);
        }
    }
    GlobalForceMoment = Rotation*Rotation1*LocalForceMoment;
    GlobalForceMoment(3) = LocalForceMoment(3);
    GlobalForceMoment(4) = LocalForceMoment(4);
    GlobalForceMoment(5) = LocalForceMoment(5);
}

void Robot_State::Contactforce_update()
{
    Vector3D _lf_distance(3);
    Vector3D _rf_distance(3);
    _lf_distance.setZero();
    _rf_distance.setZero();

    _lf_distance(2) = -0.092;
    _rf_distance(2) = -0.092;

    Matrix3D temp,temp1;
    temp = _T_LFoot_global[5].linear();
    temp1 = _T_RFoot_global[5].linear();
    GlobalForceMomentCustomPos(temp,_lf_distance,_L_FT_lowpass,_L_FT_global);
    GlobalForceMomentCustomPos(temp1,_rf_distance,_R_FT_lowpass,_R_FT_global);
}

void Robot_State::updateFT(Vector6D &RFT,Vector6D &LFT)
{
    double m_ft = 1.5;
    double d_ft = 50.0;
    double k_ft = 100.0;
    double Ts = 1.0/Hz;

    if(_cnt == 0)
    {
        for(int i=0; i<6; i++)
        {
            _LFT_imp_prev(i) = LFT(i);
            _LFT_imp_prev2(i) = LFT(i);
            _LFT2_imp_prev(i) = LFT(i);
            _LFT2_imp_prev2(i) = LFT(i);

            _RFT_imp_prev(i) = RFT(i);
            _RFT_imp_prev2(i) = RFT(i);
            _RFT2_imp_prev(i) = RFT(i);
            _RFT2_imp_prev2(i) = RFT(i);
        }
        cout << "FT_initialized " << endl;
    }

    Vector6D LFT_filtered;

    LFT_filtered.setZero();
    Vector6D RFT_filtered;
    RFT_filtered.setZero();


    for (int i=0; i<6; i++)
    {
        LFT_filtered(i) = ((k_ft-2*d_ft/Ts)*_LFT_imp_prev2(i)+2*k_ft*_LFT_imp_prev(i)+(2*d_ft/Ts+k_ft)*LFT(i)-(4*m_ft/(Ts*Ts)-2*d_ft/Ts+k_ft)*_LFT2_imp_prev2(i)-(-8*m_ft/(Ts*Ts)+2*k_ft)*_LFT2_imp_prev(i))/(4*m_ft/(Ts*Ts)+2*d_ft/Ts+k_ft);
        RFT_filtered(i) = ((k_ft-2*d_ft/Ts)*_RFT_imp_prev2(i)+2*k_ft*_RFT_imp_prev(i)+(2*d_ft/Ts+k_ft)*RFT(i)-(4*m_ft/(Ts*Ts)-2*d_ft/Ts+k_ft)*_RFT2_imp_prev2(i)-(-8*m_ft/(Ts*Ts)+2*k_ft)*_RFT2_imp_prev(i))/(4*m_ft/(Ts*Ts)+2*d_ft/Ts+k_ft);
    }

    for(int i=0 ; i<6; i++)
    {
        _LFT_imp_prev2(i) = _LFT_imp_prev(i);
        _LFT_imp_prev(i) = LFT(i);
        _LFT2_imp_prev2(i) = _LFT2_imp_prev(i);
        _LFT2_imp_prev(i) = LFT_filtered(i);

        _RFT_imp_prev2(i) = _RFT_imp_prev(i);
        _RFT_imp_prev(i) = RFT(i);
        _RFT2_imp_prev2(i) = _RFT2_imp_prev(i);
        _RFT2_imp_prev(i) = RFT_filtered(i);
    }

    LFT = LFT_filtered;
    RFT = RFT_filtered;

}


