void Robot_State::uT_waist(VectorXD&q, HTransform& uT0, HTransform& uT1)
{
    uT0.linear().setZero();
    uT0.translation().setZero();
    uT1.linear().setZero();
    uT1.translation().setZero();

    uT0.linear()(0, 0) = cos(q(WA_BEGIN));
    uT0.linear()(0, 2) = sin(q(WA_BEGIN));
    uT0.linear()(1, 1) = 1.0;
    uT0.linear()(2, 0) = -sin(q(WA_BEGIN));
    uT0.linear()(2, 2) = cos(q(WA_BEGIN));


    uT1.linear()(0, 0) = cos(q(WA_BEGIN))*cos(q(WA_BEGIN+1));
    uT1.linear()(0, 1) = -cos(q(WA_BEGIN))*sin(q(WA_BEGIN+1));
    uT1.linear()(0, 2) = sin(q(WA_BEGIN));
    uT1.linear()(1, 0) = sin(q(WA_BEGIN+1));
    uT1.linear()(1, 1) = cos(q(WA_BEGIN+1));
    uT1.linear()(2, 0) = -cos(q(WA_BEGIN+1))*sin(q(WA_BEGIN));
    uT1.linear()(2, 1) = sin(q(WA_BEGIN))*sin(q(WA_BEGIN+1));
    uT1.linear()(2, 2) = cos(q(WA_BEGIN));

}

